import React from "react";
import ReactDOM from "react-dom";
import "bootstrap/dist/css/bootstrap.css";
import "../FA Icons/css/all.min.css";
class NavBar extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      menu: ["Home", "About Us", "Services", "Testimonials", "Frequenly Asked"],
    };
  }

  render() {
    const { menu } = this.state;
    return (
      <div className="container">
        <div className="row">
          <div className="w-100">
            <nav className="navbar navbar-expand-lg justify-content-between ">
              <a className=" display-4 font-weight-light text-decoration-none text-dark">
                {" "}
                rapid{" "}
              </a>
              <button
                class="navbar-toggler"
                type="button"
                data-toggle="collapse"
                data-target="#navbarSupportedContent"
                aria-controls="navbarSupportedContent"
                aria-expanded="false"
                aria-label="Toggle navigation"
              >
                <i class="fas fa-bars " style={{ fontSize: "30px" }}></i>
              </button>

              <div className="navbar-collapse collapse justify-content-end">
                <ul className="nav float-right">
                  {menu.map((item) => {
                    return (
                      <li className="nav-item">
                        <a className="nav-link text-uppercase " href="#">
                          home
                        </a>
                      </li>
                    );
                  })}

                  <li className="nav-item">
                    <a className="nav-link text-uppercase" href="#">
                      about us
                    </a>
                  </li>
                  <li className="nav-item">
                    <a className="nav-link text-uppercase" href="#">
                      services
                    </a>
                  </li>
                  <li className="nav-item text-uppercase">
                    <a className="nav-link" href="#">
                      portfolio
                    </a>
                  </li>
                  <li className="nav-item text-uppercase">
                    <a className="nav-link" href="#">
                      team
                    </a>
                  </li>
                  <li className="nav-item text-uppercase">
                    <a className="nav-link" href="#">
                      more
                    </a>
                  </li>
                  <li className="nav-item text-uppercase">
                    <a className="nav-link" href="#">
                      contact us
                    </a>
                  </li>
                </ul>
              </div>
            </nav>
          </div>
        </div>
      </div>
    );
  }
}

export default NavBar;
